INSERT INTO `questionnaires` VALUES (1,'{\"ro\":\"Despre muzic\\u0103\",\"en\":\"About music\"}','{\"ro\":\"Doar un alt chestionar despre muzic\\u0103\",\"en\":\"Just another questionnaire about music\"}',3,'normal','normal'),(2,'{\"ro\":\"Despre fotbal\",\"en\":\"About football\"}','{\"ro\":\"quest_desc_ro\",\"en\":\"quest_desc_en\"}',10,'normal','360'),(3,'{\"ro\":\"Roata Profil\",\"en\":\"Profil Wheel\"}','{\"ro\":\"In roata de mai jos veti gasi un num\\u0103r de cuvinte \\u0219i expresii care descriu diferite emotii \\u0219i trairi. Citi\\u021bi fiecare item \\u0219i apoi marca\\u021bi r\\u0103spunsul adecvat.\",\"en\":\"quest_desc_en\"}',0,'radial','360'),(4,'{\"ro\":\"M-RIBS\",\"en\":\"M-RIBS\"}','{\"ro\":\"Atunci cand se confrunta cu situatii negative, unii angajati au tendinta sa gandeasca in termeni de trebuie cu necesitate\\/ neparat. In acelea\\u015fi situatii, al\\u0163i oameni g\\u00e2ndesc \\u00een termeni preferen\\u0163iali \\u015fi accept\\u0103 situa\\u0163ia, chiar dac\\u0103 i\\u015fi doresc foarte mult ca acele situatii sa nu se intample. \\r\\nDe exemplu, unii manageri pot gandi: \\u201cAr fi trebuit s\\u0103 asculte c\\u00eend vobesc\\u201d sau \\u201cA\\u015f fi vrut s\\u0103 m\\u0103 asculte dar asta nu \\u00eenseamn\\u0103 c\\u0103 asa \\u015fi trebuie s\\u0103 se \\u00eent\\u00e2mple\\u201d sau pot avea ambele ganduri. \\r\\nDin perspectiva acestor posibilitati, estima\\u0163i c\\u00e2t de mult reprezint\\u0103 afirma\\u0163iile de mai jos g\\u00e2ndurile pe care le-a\\u0163i avut \\u00een situa\\u0163ia amintit\\u0103.\",\"en\":\"Atunci cand se confrunta cu situatii negative, unii angajati au tendinta sa gandeasca in termeni de trebuie cu necesitate\\/ neparat. In acelea\\u015fi situatii, al\\u0163i oameni g\\u00e2ndesc \\u00een termeni preferen\\u0163iali \\u015fi accept\\u0103 situa\\u0163ia, chiar dac\\u0103 i\\u015fi doresc foarte mult ca acele situatii sa nu se intample. \\r\\nDe exemplu, unii manageri pot gandi: \\u201cAr fi trebuit s\\u0103 asculte c\\u00eend vobesc\\u201d sau \\u201cA\\u015f fi vrut s\\u0103 m\\u0103 asculte dar asta nu \\u00eenseamn\\u0103 c\\u0103 asa \\u015fi trebuie s\\u0103 se \\u00eent\\u00e2mple\\u201d sau pot avea ambele ganduri. \\r\\nDin perspectiva acestor posibilitati, estima\\u0163i c\\u00e2t de mult reprezint\\u0103 afirma\\u0163iile de mai jos g\\u00e2ndurile pe care le-a\\u0163i avut \\u00een situa\\u0163ia amintit\\u0103.\"}',4,'normal','normal'),(5,'{\"ro\":\"Profilul Distresului Afectiv (PDA) PLUS\",\"en\":\"Profilul Distresului Afectiv (PDA) PLUS\"}','{\"ro\":\"Mai jos v\\u0103 prezent\\u0103m o list\\u0103 de cuvinte care descriu emo\\u0163iile pe care oamenii le au \\u00een diverse situa\\u0163ii.\\r\\nCiti\\u0163i cu aten\\u0163ie fiecare cuv\\u00e2nt, apoi marca\\u0163i prin colorarea cercule\\u0163ului corespunz\\u0103tor varianta care\\r\\ncorespunde cel mai bine \\u00eentreb\\u0103rii:\\r\\n\\r\\nCUM V-A\\u0162I SIM\\u0162IT \\u00ceN ULTIMELE DOU\\u0102 S\\u0102PT\\u0102M\\u00c2NI?\",\"en\":\"Mai jos v\\u0103 prezent\\u0103m o list\\u0103 de cuvinte care descriu emo\\u0163iile pe care oamenii le au \\u00een diverse situa\\u0163ii.\\r\\nCiti\\u0163i cu aten\\u0163ie fiecare cuv\\u00e2nt, apoi marca\\u0163i prin colorarea cercule\\u0163ului corespunz\\u0103tor varianta care\\r\\ncorespunde cel mai bine \\u00eentreb\\u0103rii:\\r\\n\\r\\nCUM V-A\\u0162I SIM\\u0162IT \\u00ceN ULTIMELE DOU\\u0102 S\\u0102PT\\u0102M\\u00c2NI?\"}',200,'normal','normal'),(6,'{\"ro\":\"q tester\",\"en\":\"q tester\"}','{\"ro\":\"jhgjhg\",\"en\":\"jhgjhg\"}',2,'normal','normal');
