ngrozitor c\\u00e2nd nu ob\\u0163in performante ridicate si nu sunt apreciat. \"}','choice'),(41,4,'{\"ro\":\"Este insuportabil si nu pot tolera sa nu am rezultate ridicate si sa fiu apreciat in munca pe care o desfasor.\",\"en\":\"Este insuportabil si nu pot tolera sa nu am rezultate ridicate si sa fiu apreciat in munca pe care o desfasor.\"}','choice'),(42,4,'{\"ro\":\"Pot suporta atunci cand nu am rezultate ridicate si nu sunt apreciat in munca mea, chiar daca imi este dificil sa tolerez acest lucru. \",\"en\":\"Pot suporta atunci cand nu am rezultate ridicate si nu sunt apreciat in munca mea, chiar daca imi este dificil sa tolerez acest lucru. \"}','choice'),(43,4,'{\"ro\":\"Imi doresc foarte mult sa am rezultate bune si sa fiu apreciat pentru munca mea, dar realizez si accept ca lucrurile nu trebuie sa fie intotdeauna asa cum vreau eu sa fie. \",\"en\":\"Imi doresc foarte mult sa am rezultate bune si sa fiu apreciat pentru munca mea, dar realizez si accept ca lucrurile nu trebuie sa fie intotdeauna asa cum vreau eu sa fie. \"}','choice'),(44,4,'{\"ro\":\"Este neplacut si regretabil sa nu ai rezultate ridicate si sa nu fii apreciat pentru munca ta, dar nu este groaznic.\",\"en\":\"Este neplacut si regretabil sa nu ai rezultate ridicate si sa nu fii apreciat pentru munca ta, dar nu este groaznic.\"}','choice'),(45,4,'{\"ro\":\"Atunci cand nu obtin performante ridicate si nu sunt apreciat, ma pot accepta ca fiind valoros si competent in ciuda performantei mele. \",\"en\":\"Atunci cand nu obtin performante ridicate si nu sunt apreciat, ma pot accepta ca fiind valoros si competent in ciuda performantei mele. \"}','choice'),(46,4,'{\"ro\":\"Imi doresc mult sa obtin performante ridicate si sa fiu printre cei mai buni in munca pe care o desfasor, dar asta nu inseamna ca trebuie cu necesitate sa fiu. \",\"en\":\"Imi doresc mult sa obtin performante ridicate si sa fiu printre cei mai buni in munca pe care o desfasor, dar asta nu inseamna ca trebuie cu necesitate sa fiu. \"}','choice'),(47,4,'{\"ro\":\"Va rugam sa va ganditi la o situatie la serviciu asupra careia ati avut un control redus sau nu ati reusit sa o controlati. Incercati sa va amintiti gandurile pe care le-ati avut intr-o asemenea situatie si apreciati cat de mult reprezinta afirmatiile de mai jos gandurile pe care le-ati avut.&lt;br&gt;Trebuie neaparat sa detin controlul asupra ceea ce se intampla la serviciu. \",\"en\":\"Va rugam sa va ganditi la o situatie la serviciu asupra careia ati avut un control redus sau nu ati reusit sa o controlati. Incercati sa va amintiti gandurile pe care le-ati avut intr-o asemenea situatie si apreciati cat de mult reprezinta afirmatiile de mai jos gandurile pe care le-ati avut.&lt;br&gt;Trebuie neaparat sa detin controlul asupra ceea ce se intampla la serviciu. \"}','choice'),(48,4,'{\"ro\":\"Imi doresc foarte mult sa detin controlul la serviciu, dar nu trebuie neparat sa se intample acest lucru. \",\"en\":\"Imi doresc foarte mult sa detin controlul la serviciu, dar nu trebuie neparat sa se intample acest lucru. \"}','choice'),(49,4,'{\"ro\":\"Este groaznic daca nu detin controlul total asupra situatiilor de la serviciu. \",\"en\":\"Este groaznic daca nu detin controlul total asupra situatiilor de la serviciu. \"}','choice'),(50,4,'{\"ro\":\"Daca nu detin controlul total asupra ceea ce se intampla la serviciu, inseamna ca sunt incompetent si fara valoare. \",\"en\":\"Daca nu detin controlul total asupra ceea ce se intampla la serviciu, inseamna ca sunt incompetent si fara valoare. \"}','choice'),(51,4,'{\"ro\":\"Este de nesuportat si nu pot tolera sa nu am control asupra ceea ce se petrece la serviciu\",\"en\":\"Este de nesuportat si nu pot tolera sa nu am control asupra ceea ce se petrece la serviciu\"}','choice'),(52,4,'{\"ro\":\"Pot tolera sa nu am control asupra ceea ce se petrece la serviciu, desi imi este greu sa tolerez acest lucru.  \",\"en\":\"Pot tolera sa nu am control asupra ceea ce se petrece la serviciu, desi imi este greu